import { Field, reduxForm } from 'redux-form';

class StreamCreate extends Component {
    render() {
        return (
            <form>
                <Field name="title" component="input" type="text" />
                <Field name="description" omponent="input" type="text" />
            </form>
        );
    }
}

export default reduxForm({
    form: 'streamCreate'
})(StreamCreate);
